#Below is oupting selected angry words and scared words. If angry.txt and scared.txt are added new words manually, please
#do not runing code below
import os
os.chdir('C:\\Users\\yzhon_000\\PycharmProjects\\ChineseNLP\\venv\\lib\\site-packages\\snownlp\\sentiment\\')

scared_words = set()
angry_words = set()

for (item,list)  in senticnet.items():
    if list[0] == '#scared' or list[1] == '#scared':
        scared_words.add(item)
        list = list[4:-1]
        for word in list:
            scared_words.add(word)


for (item,list)  in senticnet.items():
    if list[0] == '#angry' or list[1] == '#angry':
        angry_words.add(item)
        list = list[4:-1]
        for word in list:
            angry_words.add(word)

f = open("scared.txt", 'w', encoding='UTF-8')

for word in scared_words:
  f.write(word)
  f.write("\n")
f.close()

f = open("angry.txt", 'w', encoding='UTF-8')

for word in angry_words:
  f.write(word)
  f.write("\n")

f.close()
